Accounts_CustomFields_Description:
Ska vara en giltig JSON där nycklarna är fältnamn som innehåller en ordbok för fältinställningar. Exempel:<br/><code>{
"roll": {
"typ": "välj",
"defaultValue": "student",
"alternativ": ["lärare", "student"],
"krävs": sant,
"modifyRecordField": {
"array": true,
"fält": "roller"
}
},
"Twitter": {
"typ": "text",
"krävs": sant,
"minlängd": 2,
"maxlängd": 10
}
}</code>

Custom_Translations_Description:
Bör vara en giltig JSON där nycklar är språk som innehåller en ordbok för nyckel och översättningar. Exempel: <br/><code>{
"en": {
"Kanaler": "Rum"
},
"pt": {
"Kanaler": "Salas"
}l
}</code>

SAML_Custom_user_data_fieldmap_descripti:
Konfigurera hur fält för användarkonto (som e-post) fylls i från en post i SAML (när den hittats). 
Med {"name":"cn", "email":"mail"} väljs till exempel en persons  mänskligt läsbara namn via attributet "cn" och e-postadressen via attributet "mail".
Tillgängliga fält i Rocket.Chat: "name", "email" och "username". Allt annat ignoreras.
```{
  "email": "mail",
  "username": {
    "fieldName": "mail",
    "regex": "(.*)@.+$",
    "template": "user-__regex__"
  },
  "name": {
   "fieldNames": [
      "firstName",
      "lastName"
    ],
    "template": "__firstName__ __lastName__"
  },
  "__identifier__": "uid"
}
